import "./GroupComponent7.css";

const GroupComponent7 = () => {
  return (
    <div className="ellipse-frame">
      <img className="group-child10" alt="" src="../ellipse-14.svg" />
      <img className="group-child11" alt="" src="../ellipse-24.svg" />
      <img className="group-child12" alt="" src="../ellipse-35.svg" />
    </div>
  );
};

export default GroupComponent7;
